import React from 'react'
import './Footer.css'
import { SocialIcon } from 'react-social-icons';

function Footer() {
  return (
    <div className='Footer'>
        <SocialIcon style={{height: "100%"}} className='icon' url="https://github.com/codetombomb" />
        <SocialIcon className='icon' url="https://www.linkedin.com/in/tomtobar/" />
        <SocialIcon className='icon' url="https://twitter.com/tom_tobar" />
    </div>
  )
}

export default Footer
